import YourProfile from './YourProfile'
import {connect} from 'react-redux'
import {ChangeNameActionCreator, ChangeAboutActionCreator, ChangeAgeActionCreator,
ChangeCityActionCreator, ChangeCountryActionCreator, ChangeGenderActionCreator,
ChangeInteresActionCreator, ChangeMeetActionCreator, ChangeWhoFindActionCreator} from './../../../Redux/YourProfileReducer'
let mapStateToProps = (state) =>
{
    return{
        YourProfile:state.YourProfile
    }
}
let mapDispatchToProps = (dispatch) =>
{
    return{
        changeName:(text) =>
        {
            dispatch(ChangeNameActionCreator(text))
        }
    }
}
let YourProfileContainer = connect(mapStateToProps) (YourProfile)
export default YourProfileContainer;
